module.exports = {
  root: true,
  parser: 'babel-eslint',
  env: {
    browser: true,
    es6: true,
    node: true,
    jest: true
  },
  plugins: ['jest'],
  rules: {
    'import/no-unresolved': 'off',
    'no-console': 'off',
    'no-case-declarations': 'off',
    'no-prototype-builtins': 'off',
    'no-unsafe-finally': 'off',
    'import/order': [
      'error',
      { 'newlines-between': 'always-and-inside-groups' }
    ],
    'react/prop-types': 'off',
    'react/display-name': 'off',
    'react/no-children-prop': 'off',
    'react-hooks/rules-of-hooks': 'error',
    'react-hooks/exhaustive-deps': 'off'
  },
  extends: [
    'react-app',
    'eslint:recommended',
    'plugin:import/errors',
    'plugin:import/warnings',
    'plugin:react/recommended',
    'plugin:jest/recommended'
  ],
  settings: {
    react: {
      version: 'detect'
    },

    'import/extensions': ['.js', '.jsx'],
    'import/resolver': {
      node: {
        extensions: ['.js', '.jsx']
      }
    }
  }
}

module.exports = {
  siteMetadata: {
    title: 'Blocks UI',
    description:
      'A JSX-based page builder for creating beautiful websites without writing code',
    author: '@blocks_ui',
    image:
      'https://user-images.githubusercontent.com/1424573/69646923-d618b800-1025-11ea-8b0f-73286a8db5bf.png'
  },
  plugins: [
    'gatsby-plugin-theme-ui',
    'gatsby-plugin-mdx',
    'gatsby-plugin-catch-links',
    'gatsby-plugin-blocks',
    {
      resolve: 'gatsby-source-filesystem',
      options: {
        name: 'blocks',
        path: 'packages/react/src'
      }
    },
    {
      resolve: 'gatsby-plugin-fathom',
      options: {
        siteId: 'ZGBAXRBH'
      }
    },
    'gatsby-plugin-react-helmet',
    {
      resolve: 'gatsby-plugin-manifest',
      options: {
        name: 'Blocks UI',
        short_name: 'Blocks',
        start_url: '/',
        background_color: '#fff',
        theme_color: '#33e',
        display: 'standalone',
        icon: 'src/assets/images/favicon.png'
      }
    }
  ]
}

const { transforms, queries } = require('blocks-ui')

const BlockTemplate = require.resolve('./src/templates/block')

const toComponentName = name => name.charAt(0).toUpperCase() + name.slice(1)

exports.sourceNodes = ({ actions }) => {
  actions.createTypes(`
    type Block implements Node {
      displayName: String!
      slug: String!
      src: String!
      usage: String!
      transformed: String!
    }
  `)
}

exports.onCreateNode = async ({
  node,
  actions,
  createNodeId,
  loadNodeContent,
  createContentDigest
}) => {
  const { createNode, createParentChildLink } = actions

  if (
    node.sourceInstanceName !== 'blocks' ||
    node.ext !== '.js' ||
    node.name === 'index'
  ) {
    return
  }

  const src = await loadNodeContent(node)
  const usage = queries.getBlocksUsage(src)
  const transformed = transforms.toTransformedJSX(
    'export default () => ' + usage
  )
  const displayName = [node.relativeDirectory.replace(/s$/, ''), node.name]
    .map(toComponentName)
    .join('')
  const nodeId = `${node.id}--${displayName}--Block`
  const contentDigest = createContentDigest(src)
  const slug = ['blocks', node.relativeDirectory, node.name].join('/')

  const blocksNode = {
    src,
    slug,
    transformed,
    displayName,
    usage,
    id: createNodeId(nodeId),
    children: [],
    internal: {
      contentDigest,
      type: 'Block'
    }
  }

  createParentChildLink({ parent: node, child: blocksNode })
  createNode(blocksNode)
}

exports.createPages = async ({ graphql, actions }) => {
  const { createPage } = actions

  const result = await graphql(`
    {
      blocks: allBlock {
        nodes {
          id
          slug
        }
      }
    }
  `)

  result.data.blocks.nodes.forEach(block => {
    createPage({
      path: block.slug,
      component: BlockTemplate,
      context: block
    })
  })
}

exports.onCreateWebpackConfig = ({ actions }) => {
  actions.setWebpackConfig({
    node: {
      fs: 'empty'
    }
  })
}
